social_posts.post_text:
Went to go see my girl @aestheticnurseali at @skinspirit 💆🏼‍♀️ Here is what we did ~

@daxxify : Areas treated - 11 lines, Forehead, Crows Feet, Marionette lines & Chin. (Daxxify can last about twice as long as Botox, depending on the patient)

Lip filler: 1/2 a syringe to create the perfect shape 

Smooth PDO threads: Used to help stimulate collagen and improve smile lines 

@restylaneusa Lyft: 1 syringe used in chin area to help with profile balancing

After 2 weeks, I went back so @aestheticnurseali could check and ensure everything settled in correctly and to make any necessary tweaks! Everything turned out so well and I’m always so impressed with her attention to detail ✨

